import Foundation

class Solution {
    func strStr(_ haystack: String, _ needle: String) -> Int {
        if haystack.count == needle.count {
            return haystack != needle ? -1 : 0
        }
        
        if let range = haystack.range(of: needle) {
            return haystack[haystack.startIndex..<range.lowerBound].count
        }
        
        return needle.isEmpty ? 0 : -1
    }
}

print(Solution().strStr("hello", "ll")) // 2
print(Solution().strStr("aaaaa", "bba")) // -1
print(Solution().strStr("", "")) // 0
print(Solution().strStr("", ""
))

